import React from "react";
import "./Styles/First.css";

// 1페이지
const First = () => {
  return (
    <a href="/2">
      <div className="wrap">
        <div className="container">
          <div className="text">
            <p style={{ textDecoration: "none" }}>화면을 터치해주세요</p>
          </div>
        </div>
        <div className="rect" />
      </div>
    </a>
  );
};

export default First;
